const light = {
  bg: 'white',
  fontColor: 'purple',
  snavbg: '#F0F2F5',
  navlinkhoverbg: 'white',
  navlinkhoverclr: 'black',
  navlinkclr: '#31373d',
  /* Theme floating button */
  floatingbg: 'white',
  sunicon: 'show',
  moonicon: 'none'
}

const dark = {
  bg: 'black',
  fontColor: 'white',
  snavbg: '#242526',
  navlinkhoverbg: 'black',
  navlinkhoverclr: 'white',
  navlinkclr: '#b6b6b6',
  /* Theme floating button */
  floatingbg: '#242526',
  sunicon: 'none',
  moonicon: 'show'
}

export const darkTheme = { ...dark }
export const lightTheme = { ...light }
